class App extends Component {
    render() {
        return (
       
            <Router>
                <div className="App">

              
                    <Switch>
                        <Route path="/" exact Component={Home} />
                        <Route path="About" Component={About} />
                        <Route path="HowItWorks" Component={HowItWorks} />
                        <Route path="WhyUs" Component={WhyUs} />
                 
                    </Switch>
                 
                </div>
            </Router>
        
           

        );
    }
}

export default App;
